                     <tr>
                      <td align="center" style="padding:0;Margin:0;padding-top:15px;padding-bottom:15px"><h2 class="es-m-txt-c" style="Margin:0;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;mso-line-height-rule:exactly;letter-spacing:0;font-size:26px;font-style:normal;font-weight:bold;line-height:31.2px;color:#333333">Thank You for Your Support!</h2></td>
                     </tr>
                     <tr>
                      <td align="justify" style="padding:0;Margin:0;padding-top:10px;padding-bottom:10px"><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px"><strong>Dear {{$name}},</strong></p><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">Thank you for your generous donation to the <strong>Partnership for Wellbeing Foundation</strong>! Your support means the world to us and empowers us to continue making a positive impact in the lives of those we serve.</p><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">Your contribution of <strong>&#8358;{{$amount}}</strong> will go directly toward our proven initiatives:</p>
                       <ul style="font-family:arial, 'helvetica neue', helvetica, sans-serif;padding:0px 0px 0px 40px;margin-top:15px;margin-bottom:15px">
                        <li style="color:#333333;margin:0px 0px 15px;font-size:14px;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif"><strong style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">Addressing Climate Challenges</strong><span style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">: Promoting renewable energy adoption and sustainable environmental practices.</span></li>
                        <li style="color:#333333;margin:0px 0px 15px;font-size:14px;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif"><strong style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">Enhancing Healthcare Access</strong><span style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">: Delivering essential medical resources to underserved communities.</span></li>
                        <li style="color:#333333;margin:0px 0px 15px;font-size:14px;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif"><strong style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">Expanding Educational Opportunities</strong><span style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">: Providing tools and programs to foster learning and growth.</span></li>
                        <li style="color:#333333;margin:0px 0px 15px;font-size:14px;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif"><strong style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">Supporting Agriculture: </strong><span style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">Empowering local farmers with resources and training for sustainable farming.</span><strong style="font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif"> </strong></li>
                       </ul><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">Every donation helps us get closer to our goal of creating a healthier, happier future for all.</p><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">If you have any questions or would like to learn more about how your contribution is making a difference, feel free to reach out to us at <a href="mailto:contact@partnershipforwellbeing.org" target="_blank" style="mso-line-height-rule:exactly;text-decoration:underline;color:#5C68E2;font-size:14px;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif">support@p4w&nbsp;</a> or visit our website at&nbsp; <a href="https://www.partnershipforwellbeing.org/p4w/blogs" target="_blank" style="mso-line-height-rule:exactly;text-decoration:underline;color:#5C68E2;font-size:14px">Partnership For&nbsp;Wellbeing Foundation</a> &nbsp;</p><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">&nbsp;.</p><p style="Margin:0;mso-line-height-rule:exactly;font-family:helvetica, 'helvetica neue', arial, verdana, sans-serif;line-height:21px;letter-spacing:0;color:#333333;font-size:14px">Once again, thank you for your generosity and for being an integral part of our mission. Together, we’re transforming lives!</p></td>
                     </tr>
